<template>
  <v-dialog
    v-model="dialog"
    max-width="900"
    persistent
    style="overflow: hidden !important"
  >
    <v-card>
      <v-card-title>
        {{ processType == "new" ? "Slider Ekle" : "Slider Düzenle" }}
        <v-spacer></v-spacer>
        <v-btn @click="closeDialog()" color="danger darken-2" icon>
          <v-icon>mdi-close</v-icon>
        </v-btn>
      </v-card-title>
      <v-card-text>
        <div class="container">
          <div class="row">
            <div class="col-lg-12 text-center">
              <img
                :src="slider.image"
                alt=""
                style="width: 300px; height: auto"
                @click="expandImage(slider.image)"
              />
            </div>
            <div class="col-md-12 text-center">
              <label for="">Resim</label>
              <v-file-input
                accept="image/*"
                placeholder="Dosya Seçin"
              ></v-file-input>
            </div>
            <div class="col-lg-12">
              <v-text-field
                v-model="slider.title"
                label="Başlık"
                :error-messages="validationMessages($v.slider.title, 'Başlık')"
                prepend-inner-icon="mdi-page-layout-header"
                @input="$v.slider.title.$touch()"
                @blur="$v.slider.title.$touch()"
              ></v-text-field>
            </div>
            <div class="col-lg-12">
              <v-textarea
                v-model="slider.text"
                label="Yazı"
                :error-messages="validationMessages($v.slider.text, 'Yazı')"
                prepend-inner-icon="mdi-format-indent-increase"
                @input="$v.slider.text.$touch()"
                @blur="$v.slider.text.$touch()"
              ></v-textarea>
            </div>
            <div class="col-lg-6">
              <v-text-field
                v-model="slider.sequence"
                label="Sıra"
                type="number"
                min="1"
                :error-messages="
                  validationMessages($v.slider.sequence, 'Taksit')
                "
                prepend-inner-icon="mdi-numeric"
                @input="$v.slider.sequence.$touch()"
                @blur="$v.slider.sequence.$touch()"
              ></v-text-field>
            </div>
            <div class="col-lg-6">
              <v-text-field
                v-model="slider.url"
                label="URL"
                prepend-inner-icon="mdi-web"
              ></v-text-field>
            </div>
            <div class="col-lg-6">
              <v-menu
                :close-on-content-click="false"
                :nudge-right="40"
                transition="scale-transition"
                offset-y
                min-width="auto"
              >
                <template v-slot:activator="{ on, attrs }">
                  <v-text-field
                    :value="
                      slider.startDate
                        ? moment(slider.startDate)
                            .locale('tr')
                            .format('DD MMMM YYYY')
                        : ''
                    "
                    label="Başlangıç Tarihi"
                    :error-messages="
                      validationMessages(
                        $v.slider.startDate,
                        'Başlangıç Tarihi'
                      )
                    "
                    prepend-inner-icon="mdi-calendar"
                    @input="$v.slider.startDate.$touch()"
                    @blur="$v.slider.startDate.$touch()"
                    readonly
                    v-bind="attrs"
                    v-on="on"
                  ></v-text-field>
                </template>
                <v-date-picker
                  v-model="slider.startDate"
                  locale="tr"
                ></v-date-picker>
              </v-menu>
            </div>
            <div class="col-lg-6">
              <v-menu
                :close-on-content-click="false"
                :nudge-right="40"
                transition="scale-transition"
                offset-y
                min-width="auto"
              >
                <template v-slot:activator="{ on, attrs }">
                  <v-text-field
                    :value="
                      slider.finishDate
                        ? moment(slider.finishDate)
                            .locale('tr')
                            .format('DD MMMM YYYY')
                        : ''
                    "
                    label="Bitiş Tarihi"
                    :error-messages="
                      validationMessages($v.slider.finishDate, 'Bitiş Tarihi')
                    "
                    prepend-inner-icon="mdi-calendar"
                    @input="$v.slider.finishDate.$touch()"
                    @blur="$v.slider.finishDate.$touch()"
                    readonly
                    v-bind="attrs"
                    v-on="on"
                  ></v-text-field>
                </template>
                <v-date-picker
                  v-model="slider.finishDate"
                  locale="tr"
                ></v-date-picker>
              </v-menu>
            </div>
            <div class="col-lg-6">
              <label for="">Aktiflik Durumu</label>
              <v-switch
                v-model="slider.isActive"
                :label="slider.isActive ? 'Aktif' : 'Pasif'"
              >
              </v-switch>
            </div>
          </div>
        </div>
      </v-card-text>
      <v-card-actions>
        <v-spacer></v-spacer>
        <v-btn text color="secondary" @click="closeDialog()">İptal</v-btn>
        <v-btn text color="success" @click="saveForm">Kaydet</v-btn>
      </v-card-actions>
    </v-card>
  </v-dialog>
</template>

<script>
import { required } from "vuelidate/lib/validators";
import { validationMixin } from "vuelidate";
import { validationMessages } from "@/validationMessages.js";
import { mapState, mapActions } from "vuex";

import moment from "moment";
//import simplebar from "simplebar-vue";

export default {
  mixins: [validationMixin],

  validations() {
    //const self = this;
    return {
      slider: {
        title: { required },
        text: { required },
        sequence: { required },
        startDate: { required },
        finishDate: { required },
      },
    };
  },

  components: {
    //  simplebar
  },

  props: {
    showDialog: {
      type: Boolean,
      default: false,
    },
    sliderProp: {
      type: Object,
      default: () => ({
        id: null,
        image: null,
        title: "",
        content: "",
        order: "",
        startDate: "",
        isActive: true,
      }),
    },
    processType: {
      type: String,
      default: "new",
    },
  },
  computed: {
    ...mapState("auth", ["user"]),
  },
  data() {
    return {
      dialog: false,
      showPassword: false,
      roleGroupList: ["Yönetici", "Plasiyer", "Müşteri"],
      slider: {
        image: null,
        title: "",
        content: "",
        order: "",
        startDate: "",
        isActive: true,
      },
    };
  },
  methods: {
    ...mapActions("slider", ["sliderAdd", "sliderUpdate"]),
    validationMessages,
    closeDialog() {
      this.dialog = false;
      this.$v.$reset();
    },
    moment(date) {
      return moment(date);
    },
    async saveForm() {
      this.$v.$touch();

      if (!this.$v.$invalid) {
        if (this.processType == "new") {
          await this.sliderAdd({
            params: {
              userId: this.user.UserId,
            },
            body: {
              title: this.slider.title,
              text: this.slider.text,
              image:
                "",
              sequence: this.slider.sequence,
              startDate: this.slider.startDate,
              finishDate: this.slider.finishDate,
              isActive: this.slider.isActive,
            },
            urlSegments: [],
          });
        } else {
          await this.sliderUpdate({
            params: {
              userId: this.user.UserId,
            },
            body: {
              id: this.slider.id,
              title: this.slider.title,
              text: this.slider.text,
              image:
                "",
              sequence: this.slider.sequence,
              startDate: this.slider.startDate,
              finishDate: this.slider.finishDate,
              isActive: this.slider.isActive,
            },
            urlSegments: [],
          });
        }
        this.closeDialog();
      }
    },
    expandImage(images) {
      this.$viewerApi({
        images: [images],
      });
    },
  },
  watch: {
    dialog: function (newVal) {
      this.$emit("dialogChange", newVal);
    },
    showDialog: function (newVal) {
      this.dialog = newVal;
    },
    sliderProp: function (newVal) {
      if (newVal) this.slider = Object.assign({}, newVal);
      else
        this.slider = {
          image: null,
          title: "",
          content: "",
          order: "",
          startDate: "",
          isActive: true,
        };
    },
  },
};
</script>